import{_ as a,c as t,o as l,aN as r}from"./chunks/framework.CMIDsdwV.js";const d=JSON.parse('{"title":"EasyExcel概述","description":"","frontmatter":{"title":"EasyExcel概述","tags":["EasyExcel"],"categories":["EasyExcel"]},"headers":[],"relativePath":"常用框架/EasyExcel/0_EasyExcel概述.md","filePath":"常用框架/EasyExcel/0_EasyExcel概述.md","lastUpdated":1767444225000}'),s={name:"常用框架/EasyExcel/0_EasyExcel概述.md"};function c(o,e,n,i,h,p){return l(),t("div",null,[...e[0]||(e[0]=[r('<div style="display:none;" hidden="true" aria-hidden="true">Are you an LLM? You can read better optimized documentation at /常用框架\\EasyExcel\\0_EasyExcel概述.md for this page in Markdown format</div><h1 id="easyexcel概述" tabindex="-1">EasyExcel概述 <a class="header-anchor" href="#easyexcel概述" aria-label="Permalink to &quot;EasyExcel概述&quot;">​</a></h1><blockquote><p>官方文档：<a href="https://easyexcel.opensource.alibaba.com" target="_blank" rel="noreferrer">https://easyexcel.opensource.alibaba.com</a></p></blockquote><h3 id="什么是alibaba-easyexcel" tabindex="-1">什么是Alibaba-EasyExcel <a class="header-anchor" href="#什么是alibaba-easyexcel" aria-label="Permalink to &quot;什么是Alibaba-EasyExcel&quot;">​</a></h3><p>EasyExcel是阿里巴巴开源的一个excel处理框架，<strong>以使用简单、节省内存著称</strong>。EasyExcel能大大减少占用内存的主要原因是在解析Excel时没有将文件数据一次性全部加载到内存中，而是从磁盘上一行行读取数据，逐个解析。</p><h3 id="easyexcel与其它框架的区别" tabindex="-1">EasyExcel与其它框架的区别 <a class="header-anchor" href="#easyexcel与其它框架的区别" aria-label="Permalink to &quot;EasyExcel与其它框架的区别&quot;">​</a></h3><p>Apache poi、jxl等处理Excel的框架，他们都存在一个严重的问题就是非常的耗内存。如果你的系统并发量不大的话可能还行，但是一旦并发上来后一定会OOM或者JVM频繁的full gc。而EasyExcel采用一行一行的解析模式，并将一行的解析结果以观察者的模式通知处理（AnalysisEventListener）。</p><h3 id="参考资料" tabindex="-1">参考资料 <a class="header-anchor" href="#参考资料" aria-label="Permalink to &quot;参考资料&quot;">​</a></h3><p><a href="https://zhuanlan.zhihu.com/p/471712987" target="_blank" rel="noreferrer">https://zhuanlan.zhihu.com/p/471712987</a></p><p><a href="https://blog.csdn.net/chire_jr/article/details/106492700" target="_blank" rel="noreferrer">https://blog.csdn.net/chire_jr/article/details/106492700</a></p><p><a href="https://max.book118.com/html/2023/0510/8133104073005065.shtm" target="_blank" rel="noreferrer">https://max.book118.com/html/2023/0510/8133104073005065.shtm</a></p><p><a href="https://www.lsjlt.com/news/178303.html" target="_blank" rel="noreferrer">https://www.lsjlt.com/news/178303.html</a></p><p><a href="https://blog.csdn.net/weixin_43949154/article/details/122071510" target="_blank" rel="noreferrer">https://blog.csdn.net/weixin_43949154/article/details/122071510</a></p>',13)])])}const x=a(s,[["render",c]]);export{d as __pageData,x as default};
